import React, {Component, useEffect, useState} from "react";
import Brand from "../../components/Brand";
import Footer from "../../components/Footer";
import Login from "../auth/Login";
import Dashboard from "../../components/dashboard/Dashboard";

export default class Account extends Component{

    component = <Dashboard></Dashboard>
    constructor(props) {
        super(props);
        this.state ={
            clicked: false
        }
        this.handleClick = this.handleClick.bind(this)
        this.dashboard = this.dashboard.bind(this)
    }

    componentDidMount() {

    }

    handleClick(e){
        this.setState({
            clicked : true
        })
        e.target.classList.toggle('active')
        // e.target.removeClass();
        // console.log(e.target.removeClass("active"))
        this.component = <Footer></Footer>

    }

    dashboard(){
        this.setState({});
        this.component = <Dashboard></Dashboard>
    }


    render() {
        return(
            <>
                <Brand></Brand>
                <div className="dashboard-section pt-120 pb-120">
                    <img alt="image" src={require("../../assets/images/bg/section-bg.png")} className="img-fluid section-bg-top" />
                    <img alt="image" src={require('../../assets/images/bg/section-bg.png')} className="img-fluid section-bg-bottom" />
                    <div className="container">
                        <div className="row ">
                            <div className="col-lg-3">
                                <div className="nav flex-column nav-pills gap-4 wow fadeInUp"
                                     data-wow-duration="1.5s" data-wow-delay=".2s" id="v-pills-tab"
                                     role="tablist" aria-orientation="vertical">
                                    <button className="nav-link active nav-btn-style mx-auto  mb-20"
                                            onClick={this.dashboard}
                                            id="v-pills-dashboard-tab" data-bs-toggle="pill" type="button" role="tab"
                                            aria-controls="v-pills-dashboard" aria-selected="true" >
                                        Dashboard
                                    </button>
                                    <button className="nav-link nav-btn-style mx-auto mb-20"
                                            onClick={this.handleClick}
                                            id="v-pills-profile-tab" data-bs-toggle="pill" type="button" role="tab"
                                            aria-controls="v-pills-profile" aria-selected="true"><i
                                        className="lar la-user"></i>
                                        My Profile
                                    </button>
                                    <button className="nav-link nav-btn-style mx-auto mb-20"
                                            id="v-pills-order-tab" data-bs-toggle="pill"
                                            data-bs-target="#v-pills-order" type="button" role="tab"
                                            aria-controls="v-pills-order" aria-selected="true">
                                        Order Bidding
                                    </button>
                                    <button className="nav-link nav-btn-style mx-auto" id="v-pills-purchase-tab"
                                            data-bs-toggle="pill" data-bs-target="#v-pills-purchase"
                                            type="button" role="tab" aria-controls="v-pills-purchase"
                                            aria-selected="true">
                                        Purchase
                                    </button>
                                    <button className="nav-link nav-btn-style mx-auto" type="button" role="tab">
                                        Logout
                                    </button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </>
        )
    }
}
